window.bookSummaryJSON = "<p><i>\"For her to love me, she had to be willing to kill me. Anything else would show that her heart was untrue.\"</i> </p> <p>The struggle against not-so-charming storybook narratives isn't the only complicating factor in Henrietta \"Henry\" Marchen's life. As part of the ATI Management Bureau team protecting the world from fairy tales gone awry, she's juggling her unwanted new status as a Snow White, dealing with a potentially dangerous Pied Piper, and wrangling a most troublesome wicked stepsister - along with a budding relationship with Jeff, her teammate. </p> <p>But when a twisted, vicious Cinderella breaks out of prison and wreaks havoc, things go from disenchanted to deadly. And once Henry realizes someone is trying to use her to destroy the world, her story becomes far from over - and this one might not have a happily ever after. </p> <p><i>Indexing: Reflections</i> is <i>New York Times</i> bestselling author Seanan McGuire's continuing new urban fantasy, where everything you thought you knew about fairy tales gets turned on its head. </p>"; 
